$templateCache.put("docs/base-js/sections/base-helpers.section.html","<doc-section><doc-header id=\"base-helpers\">BaseHelpers</doc-header><p>BaseHelpers is an additional light-weight object with commonly used functions that is bundled with base-js. It is automatically included when base-js is loaded.</p><table class=\"table striped bordered\"><thead><th>Function</th><th>Purpose</th><th>Parameters</th></thead><tbody><tr><td>setCookie</td><td>Set value of a browser cookie.</td><td>(name, value, hours)</td></tr><tr><td>getCookie</td><td>Retrieve a value of a browser cookie.</td><td>(name)</td></tr><tr><td>inverseTables</td><td>Return an object with reversed key-values.</td><td>(key-value object)</td></tr><tr><td>getUrlParam</td><td>Retrieve value of URL parameter</td><td>(name)</td></tr><tr><td>formatDateElement</td><td>Format date property(hour, minute) to a two-digit #.</td><td>(value)</td></tr><tr><td>dateToString</td><td>Format date to mm-dd-yyyy</td><td>(milliseconds)</td></tr><tr><td>dateTimeToString</td><td>Format date to mm-dd-yyyy HH:MM</td><td>(milliseconds, timezone)</td></tr><tr><td>durationToString</td><td>Format duration value</td><td>(milliseconds, format)</td></tr><tr><td>timeOfDayToString</td><td>Format time of day value.</td><td>(milliseconds)</td></tr><tr><td>redirectToEditForm</td><td>Redirect to QuickBase table edit form.</td><td>(dbid, rid, root)</td></tr><tr><td>redirectToViewForm</td><td>Redirect to QuickBase table view form.</td><td>(dbid, rid, root)</td></tr><tr><td>downloadFile</td><td>Download QuickBase file attachment.</td><td>(dbid, rid, fid, version)</td></tr></tbody></table><doc-notice>BaseHelpers is bundled and automatically loaded with base-js. There is no additional requiring to access these functions.</doc-notice></doc-section>");
$templateCache.put("docs/base-js/sections/change-log.section.html","<doc-section><doc-header id=\"change-log\">Change Log</doc-header><p><b>base-js</b> uses semantic-versioning in the format of x.y.z(Major.Minor.Patch)</p><ul><li>x stands for a major version</li><li>y stands for a minor version</li><li>z stands for a patch</li></ul><p>Versions:</p><table class=\"table bordered striped\"><thead><th>Version</th><th>Description</th><th>Deployment Date</th></thead><tr><td>4.9.0</td><td>QuickBase API call error management.</td><td>07/01/2016</td></tr><tr><td>4.8.2</td><td>Local development proxy url updated.</td><td>06/01/2016</td></tr><tr><td>4.8.1</td><td>Return json errors.</td><td>05/01/2016</td></tr><tr><td>4.8.0</td><td>Added QuickStart portal functionality.</td><td>04/01/2016</td></tr></table><doc-notice><br>CDN:<br>https://s3.amazonaws.com/ais_libraries/BaseJS/x.x.x/base.min.js</doc-notice><doc-best-practice>Ensure to contribute any <b>base-js</b> changes to this documentation with the new version and a description of change.</doc-best-practice></doc-section>");
$templateCache.put("docs/base-js/sections/common-functions.section.html","<doc-section><doc-header id=\"common-functions\">Common Functions</doc-header><p>The majority of API calls in the QuickBase API are covered by base-js but some API calls are much more utilized than others. Below are the list of the most common functions:</p><doc-header id=\"do-query\" class=\"secondary\">doQuery</doc-header><doc-caption>Used to retrieve records from a table.</doc-caption><a href=\"https://www.quickbase.com/api-guide/index.html#do_query.html\" target=\"_blank\">API_DoQuery</a><h5>Request</h5><table class=\"table striped bordered\"><thead><th>Parameter</th><th>Type</th><th>Value</th><th>Required</th></thead><tbody><tr><td>query</td><td>object | array</td><td>Valid query filter</td><td>yes</td></tr><tr><td>options</td><td>object</td><td><a href=\"http://www.quickbase.com/api-guide/index.html#do_query.html#Request_Parameters\" target=\"_blank\">API</a></td><td>yes, if no options still use {}</td></tr></tbody></table><h5>Response</h5><table class=\"table bordered striped\"><thead><th>Response</th><th>Type</th><th>Value</th></thead><tbody><tr><td>records matched</td><td>array of objects</td><td>object\'s contains all table fields(key) and record values(value) set in configuration or clist</td></tr></tbody></table><h5>Example</h5><pre>\n    <code class=\"language-javascript\">\n      //retrieve all primary toy records\n      db.toys.doQuery({ primary: \"1\" }, { slist: [6,9] }).then(function(toys){\n        /*\n          toys => [\n            { name: \"Buzz Lightyear\", description: \"Space-ranger action figure who wears a space suit.\" },\n            { name: \"Woody\", description: \"Cowbody doll, Andy\'s favorite.\" },\n            { name: \"Jesse\", description: \"Cowgirl doll and part of the Woody\'s Round Up gang.\" }\n          ]\n        */\n      });\n    </code>\n  </pre><doc-header id=\"add-record\" class=\"secondary\">addRecord</doc-header><doc-caption>Used to add a single record to a table.</doc-caption><a href=\"https://www.quickbase.com/api-guide/index.html#add_record.html\" target=\"_blank\">API_AddRecord</a><h5>Request</h5><table class=\"table striped bordered\"><thead><th>Parameter</th><th>Type</th><th>Value</th><th>Required</th></thead><tbody><tr><td>record</td><td>object</td><td>object of field-values</td><td>yes</td></tr></tbody></table><h5>Response</h5><table class=\"table bordered striped\"><thead><th>Response</th><th>Type</th><th>Value</th></thead><tbody><tr><td>record id</td><td>int</td><td>auto-generated record id</td></tr></tbody></table><h5>Example</h5><pre>\n    <code class=\"language-javascript\">\n      //add new toy record\n      let toy = { \n        name: \"Hamm\", \n        description: \"Wisecracking realist piggy bank.\", \n        voicedBy: \"John Ratzenberger\" \n      };\n\n      db.toys.addRecord(toy).then(function(newRecordId){\n        //newRecordId => 10001\n      });\n    </code>\n  </pre><doc-header id=\"delete-record\" class=\"secondary\">deleteRecord</doc-header><doc-caption>Used to delete a single record from a table.</doc-caption><a href=\"https://www.quickbase.com/api-guide/index.html#delete_record.html\" target=\"_blank\">API_DeleteRecord</a><h5>Request</h5><table class=\"table striped bordered\"><thead><th>Parameter</th><th>Type</th><th>Value</th><th>Required</th></thead><tbody><tr><td>record id</td><td>string | int</td><td>Existing record id</td><td>yes</td></tr></tbody></table><h5>Response</h5><table class=\"table bordered striped\"><thead><th>Response</th><th>Type</th><th>Value</th><th>Example</th></thead><tbody><tr><td>success or failure</td><td>boolean</td><td>true if record was successfully deleted, false if the record was not deleted.</td><td>10001</td></tr></tbody></table><h5>Example</h5><pre>\n    <code class=\"language-javascript\">\n      //delete toy record\n      db.toys.delete(10001).then(function(deleted){\n        //deleted => true\n      });\n    </code>\n  </pre><doc-header id=\"import-from-csv\" class=\"secondary\">importFromCSV</doc-header><doc-caption>Used to add a collection of records to a table.</doc-caption><a href=\"https://www.quickbase.com/api-guide/index.html#import-from-csv.html\" target=\"_blank\">API_ImportFromCSV</a><h5>Request</h5><table class=\"table striped bordered\"><thead><th>Parameter</th><th>Type</th><th>Value</th><th>Required</th></thead><tbody><tr><td>array of records</td><td>array</td><td>objects of field-values</td><td>yes</td></tr></tbody></table><h5>Response</h5><table class=\"table bordered striped\"><thead><th>Response</th><th>Type</th><th>Value</th></thead><tbody><tr><td>array of new records id\'s</td><td>array</td><td>record id\'s</td></tr></tbody></table><h5>Example</h5><pre>\n    <code class=\"language-javascript\">\n      //import collection of toys\n      let toys = [\n        { name: \"Rex\", description: \"Excitable large, green, plastic Tyrannosaurus rex.\", voicedBy: \"Wallace Shawn\" },\n        { name: \"Slinky Dog\", description: \"Dachshund w/ slinky for body, speaks with a southern accent.\", voicedBy: \"Jim Varney\" },\n        { name: \"Mr. Potato Head\", description: \"Doll based on the real-life toy by Playskool.\", voicedBy: \"Don Rickles.\" },\n        { name: \"Bullseye\", description: \"Woody\'s horse that acts like a dog.\", voicedBy: \"\" },\n        { name: \"Bo Peep\", description: \"Porcelain figurine attached to Molly\'s bedside lamp.\", voicedBy: \"Annie Potts\" },\n      ];\n\n      db.toys.importFromCSV(toys).then(function(newRecordIds){\n        //newRecordIds => [10001, 10002, 10003, 10004, 10005]\n      }); \n    </code>\n  </pre><doc-best-practice>If adding a collection of records, use importFromCSV instead of addRecord. importFromCSV is way faster.</doc-best-practice></doc-section>");
$templateCache.put("docs/base-js/sections/deployment.section.html","<doc-section><doc-header id=\"deployment\" nav-text=\"Deployment\">Deployment</doc-header><p><b>base-js</b> is hosted on Amazon S3. When deploying a new version, a new Amazon S3 folder and file will be generated and a new CDN url will be automatically generated.</p><p>To deploy a new version, run \"gulp deploy\". The \'./src/base.js\' version will be compiled and stored in \"./dist/x.y.z/base.min.js\" and automatically uploaded to Amazon S3.</p><doc-notice>Ensure to update the quickstart section and the change log of the documentation to reflect the lastest version.</doc-notice><doc-best-practice>Always deploy a new version no matter how small the patch.</doc-best-practice><doc-warning>Deploying changes to an existing version will overwrite the existing Amazon S3 file.</doc-warning></doc-section>");
$templateCache.put("docs/base-js/sections/error-handling.section.html","<doc-section><doc-header id=\"error-handling\">Error Handling</doc-header><p>As of v4.9.0, all HTTP errors or QuickBase errors are returned.</p><p>Errors will bypass any callback functions and automatically return an error JSON object. A message description of the error will be included along with a error code. The error code will either reflect a network error code or the actual <a href=\"http://www.quickbase.com/api-guide/index.html#errorcodes.html\" target=\"_blank\">QuickBase error codes</a>.</p><h5>Examples</h5><pre>\n  	<code class=\"language-javascript\">\n  		{ error: { message: \"Something went wrong.\", code: \"500\" } }\n  		{ error: { message: \"Invalid input\", code: \"2\" } }\n  		{ error: { message: \"Missing required field\", code: \"50\" } }\n  	</code>\n  </pre><doc-warning>Please provide feedback on error handling as neccessary as this is a new as of v4.9.0 and may not meet all needs.</doc-warning></doc-section>");
$templateCache.put("docs/base-js/sections/introduction.section.html","<doc-section><doc-header id=\"introduction\">Introduction</doc-header><doc-caption><p><b>base-js</b> is a JavaScript library built for the QuickBase API.</p></doc-caption><p><b>base-js</b> includes functions for almost all <a href=\"http://www.quickbase.com/api-guide/index.html\" target=\"_blank\">QuickBase API calls</a>. It provides common helper functions, query selectors and finder methods. Everything is JSON instead of QuickBase\'s default XML. Promises and callbacks are both supported.</p></doc-section>");
$templateCache.put("docs/base-js/sections/querying.section.html","<doc-section><doc-header id=\"querying\">Querying</doc-header><p>To query records in a table, you must specify the conditions that determine which records to select for read, update, and delete operations by using query filters and comparison operators.</p><doc-header id=\"query-filters\" class=\"secondary\">Query Filters</doc-header><p>A query filter is an object that includes a single field-value condition or collections of conditions with corresponding query comparison operators. This isn\'t a new concept and was inspired by <a href=\"https://docs.mongodb.com/manual/tutorial/query-documents/\" target=\"_blank\">MongoDB</a> method of querying records.</p><p>{ field: value } or { field : { XEX: value } }</p><doc-notice>The field value in a query is the name you set in your original configuration object in your table fields. Never use field id\'s, it won\'t work and it is not good practice.</doc-notice><doc-header id=\"query-examples\" class=\"secondary\">Query Examples</doc-header><pre>\n    <code class=\"language-javascript\">\n      { name: \"Woody\" },\n      { description: { XEX: \"cowboy\" } },\n      { name: \"Woody\", voicedBy: \"Tom Hanks\" },\n      { or: [{ name: \"Woody\" }, { name: \"Buzz\" }] },\n      { or: [{ name: { XEX: \"Buzz\"} }, { voicedBy: \"Tom Hanks\" }] },\n      { or: [{ name: { CT: \"Buzz\"} }, { name: \"Hamm\" }, { voicedBy: { CT: \"Hanks\" } }] },\n      { name: \"Woody\", or: [{ voicedBy: \"Tim Allen\" }] },\n      { name: \"Woody\", or: [{ voicedBy: \"Tim Allen\" }], recordId: 10001 },\n      { name: { in: [\"Woody\", \"Buzz\"]}}\n    </code>\n  </pre><doc-header id=\"comparison-operators\" class=\"secondary\">Comparison Operators</doc-header><p>All <a href=\"https://www.quickbase.com/api-guide/index.html#do_query.html#queryOperators\" target=\"_blank\">QuickBase API query comparison operators</a> are allowed.</p><doc-notice>By default a simple { field : value } will be treated as an equals operator(\"EX\").</doc-notice><p>Common comparison operators include:</p><table class=\"table striped bordered\"><thead><th>Operator</th><th>Detail</th><th>Example</th></thead><tbody><tr><td>EX</td><td>is equal to value</td><td>{ name: \"Woody\" }</td></tr><tr><td>XEX</td><td>is not equal to value</td><td>{ name: { XEX: \"Buzz Lightyear\" } }</td></tr><tr><td>CT</td><td>contains value</td><td>{ name: { CT: \"Buzz\" } }</td></tr><tr><td>XCT</td><td>does not contain value</td><td>{ name: { XCT: \"Wood\" } }</td></tr><tr><td>OBF</td><td>on or before value</td><td>{ dateCreated: { OBF: \"01-01-2015\" } }</td></tr><tr><td>OAF</td><td>on or after value</td><td>{ dateCreated: { OAF: \"01-01-2015\" } }</td></tr><tr><td>LT</td><td>less than value</td><td>{ number_of_toys: { LT: 10 } }</td></tr><tr><td>GT</td><td>greater than value</td><td>{ number_of_toys: { GT: 12 } }</td></tr></tbody></table><doc-header id=\"query-helpers\" class=\"secondary\">Finder Methods</doc-header><p>Finder methods are used the same way as doQuery except they have a specialized purpose. Just need the first record, the last record or all records, use these quick hitters.</p><table class=\"table bordered striped\"><thead><th>Function</th><th>Purpose</th><th>Parameters</th><th>Response</th></thead><tbody><tr><td>doQueryCount</td><td>Find the number of records matching query filter</td><td>query</td><td>number of records(int)</td></tr><tr><td>find</td><td>retrieve a single record</td><td>record id</td><td>single record(object)</td></tr><tr><td>first</td><td>retrieve the first match</td><td>query, options</td><td>single record(object)</td></tr><tr><td>last</td><td>retrieve the last match</td><td>query, options</td><td>single record(object)</td></tr><tr><td>all</td><td>retrieve all records in table</td><td>options</td><td>records(array of objects)</td></tr><tr><td>getRids</td><td>retrieve any array of record id\'s</td><td>query</td><td>rids(array of record id\'s)</td></tr></tbody></table></doc-section>");
$templateCache.put("docs/base-js/sections/quickstart.section.html","<doc-section><doc-header id=\"quickstart\">Quickstart</doc-header><p>Utilizing base-js first requires a useable QuickBase application. Once you have an application, you will need to collect the database and table settings. base-js bootstraps these configurations to create a more-powerful, object-oriented client.</p><doc-header id=\"cdn\" class=\"secondary\">CDN</doc-header><p>The library is hosted and managed on <a href=\"https://github.com/AdvantageIntegratedSolutions/base-js\" target=\"_blank\">Github</a>. The CDN is hosted on Amazon S3. Include the below scripts in your project. jQuery is the only library dependency so be sure to also include jQuery in your project.</p><ul><li>https://s3.amazonaws.com/ais_libraries/BaseJS/x.x.x/base.min.js</li><li>https://ajax.googleapis.com/ajax/libs/jquery/2.2.4/jquery.min.js</li></ul><doc-notice><br>Latest Version:<br>https://s3.amazonaws.com/ais_libraries/BaseJS/4.9.0/base.min.js</doc-notice><doc-header id=\"\" class=\"secondary\">Initialize</doc-header><p>Initializing is easy, yet powerful. A <b>base-js</b> client is initialized by taking a configuration object including all the <a href=\"#settings\">settings</a> and QuickBase database properties that allow you to develop faster with an object-oriented mindset and forget about tedious QuickBase configuration.</p><pre>\n    <code class=\"language-javascript\">\n      const db = new Base(configObject);\n    </code>\n  </pre><doc-header id=\"quick-examples\" class=\"secondary\">Quick Examples</doc-header><doc-caption>Let\'s move on to some quick examples of the most commonly used functions.</doc-caption><pre>\n    <code class=\"language-javascript\">\n      const config = {\n        token: \"cgfsmfcdc5vyp5k5s7h6b6v3m9v\", //apptoken\n        async: \"promise\",\n        databaseId: \"bjbsgxy2r\", //main application dbid\n        tables: {\n          toys: {\n            dbid: \"bjbsgxy3t\", //table id\n            rid: 3, //field id\n            name: 6,\n            type: 8,\n            description: 9,\n            voicedBy: 10,\n            primary: 11\n          }\n        }\n      };\n\n      const db = new Base(config);\n\n      //retrieve all primary toy records\n      db.toys.doQuery({ primary: \"1\" }, { slist: [6,9] }).then(function(toys){\n        /*\n          toys => [\n            { name: \"Buzz Lightyear\", description: \"Space-ranger action figure who wears a space suit.\" },\n            { name: \"Woody\", description: \"Cowbody doll, Andy\'s favorite.\" },\n            { name: \"Jesse\", description: \"Cowgirl doll and part of the Woody\'s Round Up gang.\" }\n          ]\n        */\n      });\n\n      //add new toy record\n      let toy = { \n        name: \"Hamm\", \n        description: \"Wisecracking realist piggy bank.\", \n        voicedBy: \"John Ratzenberger\" \n      };\n\n      db.toys.addRecord(toy).then(function(newRecordId){\n        //newRecordId => 10001\n      });\n\n      //delete toy record\n      db.toys.delete(10001).then(function(deleted){\n        //deleted => true\n      });        \n\n      //import collection of toys\n      let toys = [\n        { name: \"Rex\", description: \"Excitable large, green, plastic Tyrannosaurus rex.\", voicedBy: \"Wallace Shawn\" },\n        { name: \"Slinky Dog\", description: \"Dachshund w/ slinky for body, speaks with a southern accent.\", voicedBy: \"Jim Varney\" },\n        { name: \"Mr. Potato Head\", description: \"Doll based on the real-life toy by Playskool.\", voicedBy: \"Don Rickles.\" },\n        { name: \"Bullseye\", description: \"Woody\'s horse that acts like a dog.\", voicedBy: \"\" },\n        { name: \"Bo Peep\", description: \"Porcelain figurine attached to Molly\'s bedside lamp.\", voicedBy: \"Annie Potts\" },\n      ];\n\n      db.toys.importFromCSV(toys).then(function(newRecordIds){\n        //newRecordIds => [10001, 10002, 10003, 10004, 10005]\n      });        \n    </code>\n  </pre></doc-section>");
$templateCache.put("docs/base-js/sections/settings.section.html","<doc-section><doc-header id=\"settings\">Settings</doc-header><doc-caption>Initialize your client using these settings in your configuration object.</doc-caption><p>When initializing a client, <b>base-js</b> takes an object of settings to help enhance its capabilities. Below are the object properties available:</p><table class=\"table striped bordered\"><thead><th>Parameter</th><th>Value</th><th>Required</th></thead><tbody><tr><td>async</td><td>\'callback\' | \'promise\' | \'false\'</td><td>yes</td></tr><tr><td>token</td><td>Application token string.</td><td>yes, if the application requires application tokens.</td></tr><tr><td>database id</td><td>QuickBase database ID</td><td>yes</td></tr><tr><td>tables</td><td>Object of table ids and field ids</td><td>yes</td></tr><tr><td>ticket</td><td>Valid authentication ticket.</td><td>no</td></tr><tr><td>username</td><td>Valid quickbase username.</td><td>no</td></tr><tr><td>password</td><td>Valid quickbase password.</td><td>no</td></tr><tr><td>ticket</td><td>Valid authentication ticket.</td><td>no</td></tr><tr><td>realm</td><td>Quickbase realm.</td><td>no</td></tr></tbody></table><doc-header id=\"tables\" class=\"secondary\">Tables</doc-header><doc-caption>Control your tables with predefined table names, field names and id\'s.</doc-caption><p>The tables parameter is an important required setting. This parameter is an object of all the tables that will be used in your application. This includes the table name, table id\'s, field name and field id\'s.</p><pre>\n    <code class=\"language-javascript\">\n      const tables = {\n        toys: {\n          dbid: \"bjbsgxy3t\",\n          rid: 3,\n          name: 6,\n          type: 8,\n          description: 9,\n          voicedBy: 10,\n          primary: 11\n        },\n\n        locations: {\n          dbid: \"bjbsgxy83\",\n          rid: 3,\n          name: 6,\n          address: 7\n        }\n      };\n    </code>\n  </pre><doc-notice>Table names and field names can be named whatever you like. No need to match anything to QuickBase. These names will be used throughout the life of your project including the request and response data.</doc-notice><doc-header id=\"async-options\" class=\"secondary\">Async Options</doc-header><doc-caption>Promises, callbacks or synchronous http requests</doc-caption><p>When you execute something synchronously, you wait for it to finish before moving on to another task. When you execute something asynchronously, you can move on to another task before it finishes. Below are the different options available for the async setting parameter:</p><p>The \'promise\' and \'callback\' setting tell the library to make all HTTP requests asynchronously. \'false\' will execute all API requests synchronously.(not recommended)</p><table class=\"table bordered striped\"><thead><th>Value</th><th>Description</th></thead><tbody><tr><td>promise</td><td>All HTTP requests will be executed asynchronously and will return a promise.</td></tr><tr><td>callback</td><td>All HTTP requests will be executed asynchronously and a callback function will be executed once the request is complete.</td></tr><tr><td>false</td><td>All HTTP requests to QuickBase will be made synchronously.</td></tr></tbody></table><doc-best-practice>Using promises should be your #1 option. Callbacks #2. Synchronous is #3 but discourged and will most likely be deprecated in future versions.</doc-best-practice></doc-section>");
$templateCache.put("docs/project-docs/sections/deployment.section.html","<doc-section><doc-header id=\"deployment\">Deployment</doc-header><p>Commit and push all changes. Application is hosted on advantage\'s web server under \"/apps/project-docs\". Pull changes to application. Production pages are all static, no restart neccessary.</p></doc-section>");
$templateCache.put("docs/project-docs/sections/doc-style-guide.section.html","<doc-section><doc-header id=\"doc-style-guide\">Doc Style Guide</doc-header><p>All documentation is written in common HTML and SASS. No new markdown language or a long list of rules. Be sure to take advantage of the responsive CSS framework included(<a target=\"_blank\" href=\"http://materializecss.com/\">Materialize</a>).</p><doc-header id=\"style-guide\" class=\"secondary\">Organization Guide</doc-header><p>To create documentation that is consistent across projects and take advantage of new reusable components, below is a list of general rules to structure and organize your documentation.</p><table class=\"table bordered striped\"><thead></thead><tbody><tr><td>Sections</td><td>For each section of documentation, create a new section file in your sections project folder and include it in your index file. This will increase maintainability over time and keep files short and sweet. Wrap all data in section with a \'doc-section\' component tag.</td></tr><tr><td>Headers</td><td>Use clear and concise header names. Headers automatically render in the side-navigation so they must be simple and make their purpose obvious. Wrap headers with a \'doc-header\' component tag so they are automatically loaded in the side-nav.</td></tr><tr><td>Misc Content</td><td>Store content in \'p\' tags.</td></tr><tr><td>Collections</td><td>Use tables to store collections. Use the \'table\' tag and include the \'table\', \'striped\', \'bordered\' classes provided by Materialize.</td></tr><tr><td>Notices</td><td>Use notices when you need to draw attention to important information. Use the \'doc-notice\', \'doc-warning\', or \'doc-best-practice\' component tags.</td></tr><tr><td>Code Examples</td><td>Include simple and direct code examples whenever possible. Use the \'code\' tag wrapped with a \'pre\' tag to display syntax highlighted code. The syntax will try to be automatically detected but to set the language explicitly include the class such as \'language-javascript\', \'language-html\' or \'language-css\'. <a href=\"http://prismjs.com/#languages-list\" target=\"_blank\">here</a> is a list of all supported languages</td></tr></tbody></table><doc-header id=\"components\" class=\"secondary\">Components</doc-header><p>Utilize these components to reuse common elements of documentation:</p><table class=\"table bordered striped\"><thead></thead><tbody><tr><td>doc-section</td><td>Use to separate sections of documentation.</td></tr><tr><td>doc-header</td><td>Use to add new header to the side-nav and create the anchor.</td></tr><tr><td>doc-caption</td><td>Pair with doc-header to create caption under header.</td></tr><tr><td>doc-notice</td><td>Use to build notice on page.</td></tr><tr><td>doc-warning</td><td>Use to build warning on page.</td></tr><tr><td>doc-best-practice</td><td>Use to build best-practive notice on page.</td></tr></tbody></table><doc-notice>These tags are optional. You can use any HTML tag you wish but these components pack a punch.</doc-notice><doc-header id=\"classes\" class=\"secondary\" it=\"has\">Classes</doc-header><p>These classes apply common styling or bind functionality to your elements as usual.</p><p></p><table class=\"table bordered striped\"><tbody><tr><td>secondary</td><td>Add this class to \'doc-header\' to have header display as a subheader in the navigation pane.</td></tr><tr><td>table</td><td>Add common styling to a table</td></tr><tr><td>striped</td><td>Add row striping to your table</td></tr><tr><td>bordered</td><td>Add borders to your table</td></tr></tbody></table></doc-section>");
$templateCache.put("docs/project-docs/sections/introduction.section.html","<doc-section><doc-header id=\"introduction\">Introduction</doc-header><doc-caption><p><b>project-docs</b> is a platform to develop and store documentation for common libraries, projects and tools.</p></doc-caption><p><b>project-docs</b> provides a standard UI to improve ease of use and readability, reusable components to shorten the documentation process and help construct documentation standards.</p><p>All documentation is written in common HTML & SASS, no new rules or markdown to learn.</p><p>Functionality includes reusable components, responsive CSS framework, automatic side-navigation/routing and syntax highlighted code examples.</p><p>Inspired by other more robust documentation UI\'s:</p><ul><li><a href=\"https://stripe.com/docs/api#intro\" target=\"_blank\">Stripe API</a></li><li><a href=\"https://angular.io/docs/ts/latest/\" target=\"_blank\">AngularJS</a></li><li><a href=\"http://underscorejs.org/\" target=\"_blank\">Underscore</a></li></ul>All project documentation can be found at <a href=\"http://docs.advantagequickstart.com/\" target=\"_blank\">http://docs.advantagequickstart.com/</a></doc-section>");
$templateCache.put("docs/project-docs/sections/new-project.section.html","<doc-section><doc-header id=\"new-project\">Document New Project</doc-header><doc-caption>Nothing new to learn. The folder organization will do most of the work.</doc-caption><p>All documentation is stored within the <a href=\"https://github.com/KitHensel/project-docs\" target=\"_blank\">project-docs</a> Angular QuickStart application.</p><p>Each documented project has its own folder under the \"/docs\" folder making it clear and easy-to-organize and find documentation. Inside each folder is an index.doc.html file and a \'sections\' folder.</p><p>Once your folder structure is setup, everything else is automatic including the routing, side-navigation, and making your project visible to the team on the dashboard.</p><doc-header id=\"instructions\" class=\"secondary\">Instructions</doc-header><ol><li>Download the <a href=\"https://github.com/KitHensel/project-docs\" target=\"_blank\">project-docs</a> application and run npm install.</li><li>Run the below project gulp task. The documentation boilerplate will automatically be generated under \"/docs/(name-of-project)\".<br><h5>gulp project --name name-of-project</h5></li><li>Add the project name and a short description to the \"/docs/index.js\" file.</li><li>Document and review locally using \"gulp local\".</li><li>When complete, commit & pull to the project-docs application at \"/apps/project-docs\" located on the web-server.</li></ol><doc-notice>The name used to title your project in the gulp task will also be the route where you can find your documentation. \'<b>localhost:3000/name-of-project</b>\' or \'<b>docs.advantagequickstart.com/name-of-project</b>\'</doc-notice><doc-warning>Ensure the project folder matches the project name in the \"/docs/index.js\" configuration file.</doc-warning></doc-section>");
$templateCache.put("docs/project-docs/sections/side-navigation.section.html","<doc-section><doc-header id=\"side-navigation\">Side-Navigation</doc-header><doc-caption>The side-navigation is automatically rendered.</doc-caption><p>To add a header to the side-navigation, add a <b>\'doc-header\'</b> tag to your document. The side-navigation will be rendered in the order the headers appear in your document. Adding the class, \"secondary\", will make the header display as a sub-header under the closest primary doc header.</p><doc-notice>Ensure to add an \'id\' attr to your headers and subheaders to create an anchor.</doc-notice><doc-warning>Place the headers and subheaders in order. It doesn\'t make sense to put a subheader before a header or have a subheader without a header.</doc-warning></doc-section>");
